import React from "react";
import { Card, CardActionArea, CardMedia, withStyles } from "@material-ui/core";
import { grey } from "@material-ui/core/colors";

import discMania from "../../../images/discmania.png";

const styles = {
  card: {
    width: 175,
    height: 250,
    backgroundColor: grey[400]
  },
  mediaContainer: {
    height: 75
  }
};

export default withStyles(styles)(({ classes }) => {
  return (
    <Card className={classes.card}>
      <CardActionArea>
        <CardMedia title="DiscMania Logo" className={classes.mediaContainer}>
          <img
            src={discMania}
            style={{
              height: "100%",
              padding: "5px 0px",
              margin: "auto",
              display: "block"
            }}
          />
        </CardMedia>
      </CardActionArea>
    </Card>
  );
});
